('Young Adult', 'Amici propter se ipsos penitus perdiderunt, sic robustus animus et excelsus omni est liber cura et angore, cum et mortem contemnit, qua qui est.', '27a6abe2-8683-41d0-86de-53b43d4fcf27', '2024-03-19 19:21:22', '2024-03-29 11:26:54'),
