('Non-fiction', 'Miser. Accedit etiam mors, quae quasi titillaret sensus, ut ita ruant itaque turbent, ut earum motus et impetus quo pertineant non intellegamus, tu tam egregios viros censes tantas res gessisse sine causa? Quae fuerit causa, mox videro; interea hoc tenebo, si ob aliquam causam ista, quae sine dubio.', '1d3f06be-2cf0-4f73-8516-e9f1b9072333', '2024-03-19 19:31:35', '2024-03-21 09:12:58'),
('Adventure', 'Suo, geometrica discere maluisset quam illum etiam ipsum dedocere. Sol Democrito magnus videtur, quippe homini erudito in geometriaque perfecto, huic pedalis fortasse; tantum enim esse omnino in nostris poetis aut inertissimae segnitiae est aut fastidii delicatissimi. Mihi quidem videtur. Ac fieri potest, ut propemodum iustioribus utamur illis, qui omnino avocent a philosophia.', '73286095-a8f0-46a5-bc52-2177db60a39b', '2024-03-19 19:40:44', '2024-03-29 19:22:40'),
('Non-fiction', 'Vel ingenii liberalitati magis conveniunt, qua qui affecti sunt in eadem causa sunt.', '0d472745-d2f8-4199-8a14-cde04d6a5f9b', '2024-03-19 19:48:28', '2024-03-28 00:34:12'),
('Historical Fiction', 'Nos abducat? Sin laboramus, quis est, qui Ennii Medeam aut Antiopam Pacuvii spernat aut reiciat, quod se isdem Euripidis fabulis delectari dicat, Latinas litteras oderit? Synephebos ego, inquit, potius Caecilii aut Andriam Terentii quam utramque Menandri legam? A quibus tantum dissentio, ut, cum Sophocles vel optime scripserit Electram.', '4b2472c1-39da-4d79-bbec-c57036dd5b21', '2024-03-19 19:56:58', '2024-03-23 10:17:16'),
('Cookbooks', 'Posidonium. Quid? Theophrastus mediocriterne delectat.', 'fa699d2a-1ff6-4919-8b29-aeed6fb3bcae', '2024-03-19 20:02:25', '2024-03-22 16:02:39'),
('Young Adult', 'Id, quod his libris quaeritur, qui sit finis, quid extremum, quid ultimum, quo sint omnia bene vivendi recteque faciendi consilia.', 'a7c7c6ec-bec0-46d1-b5c0-f1895b21c034', '2024-03-19 20:08:27', '2024-03-25 16:23:40'),
('Science Fiction', 'Natura, non potest esse dubium, quin id sit summum atque extremum bonorum omnium, beateque vivere nihil aliud sit nisi cum voluptate conectitur. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; et tamen in quibusdam neque pecuniae modus est neque honoris neque imperii nec libidinum nec epularum nec reliquarum cupiditatum.', 'b9e40773-449f-4959-aaad-606dd4627c40', '2024-03-19 20:17:28', '2024-03-23 11:54:32'),
('Cookbooks', 'Idem Lucilius, apud quem praeclare Scaevola: Graecum te, Albuci, quam Romanum atque Sabinum, municipem Ponti, Tritani, centurionum, praeclarorum hominum ac primorum signiferumque, maluisti dici. Graece ergo praetor Athenis, id quod maluisti, te, cum.', 'f09392fe-4fc5-43f5-9eb9-e6f39cccbfc8', '2024-03-19 20:21:00', '2024-03-26 19:29:39'),
('Fantasy', 'Audeam scribere? Quamquam a te ipso id quidem facio provocatus gratissimo mihi libro, quem ad modum affecta nunc est, desiderat?'' -- Nihil.', '78507970-ca74-4988-be7b-60ba7d5f8f9d', '2024-03-19 20:27:31', '2024-03-24 14:39:56'),
('Young Adult', 'Praesidium, in quo a nobis philosophia defensa et collaudata est, cum esset accusata et vituperata ab Hortensio. Qui liber cum et mortem contemnit, qua qui affecti sunt in eadem causa sunt, qua ante quam nati, et ad corpus referri, nec ob eam causam non.', '42202095-b3d9-4510-9f09-384c114611a3', '2024-03-19 20:31:01', '2024-03-20 00:55:48'),
('History', 'Tamque et operosam et perinde fructuosam relinqueret?', '991040c3-5214-44a8-ac61-ac767d3c4ddf', '2024-03-19 20:37:21', '2024-03-22 11:47:29'),
